import React, { useState } from 'react'
import { ImageUpload } from 'react-ipfs-uploader'

export const UploadToIPFS = (props) => {
    const [imageUrl, setImageUrl] = useState('')

    return (
        <div>
        <>
            <h2> NFT Asset Upload </h2>
            <ImageUpload setUrl={setImageUrl} />
            <b>AssetUrl</b> : <a
                href={imageUrl}
                target='_blank'
                rel='noopener noreferrer'
            >
                {imageUrl}
            </a>
        </>
        </div>
    )
}

export function uploadedAsset (props) {
    const assetUrl = props.imageUrl

    return assetUrl
}
